import React from "react";
import { useTranslation } from "react-i18next";
import { useCall } from "./../contexts/CallContext";
import {
  Modal,
  ModalHeader,
  ModalBody,
  CardBody,
  Button,
  ModalFooter,
} from "reactstrap";
import ICallHistory from "../alias/ICallHistory";

interface IProps {
  callHistory: ICallHistory | null;
  setCallHistory(value: ICallHistory | null): void;
}

const ModalDetailsCallHistory: React.FC<IProps> = ({
  callHistory,
  setCallHistory,
}) => {
  const { t } = useTranslation();
  const close = () => setCallHistory(null);
  const { setCallNumber } = useCall();

  return (
    <Modal backdrop="static" isOpen={callHistory ? true : false} centered>
      <ModalHeader toggle={close}>{t("Details Call History")}</ModalHeader>
      <ModalBody>
        <CardBody>
          <div>
            {t("Name")}: <strong>{callHistory?.name}</strong>
          </div>
          <div>
            {t("Number")}: <strong>{callHistory?.number}</strong>
          </div>
        </CardBody>
        <ModalFooter className="border-0">
          <Button type="button" color="default" onClick={close}>
            {t("Close")}
          </Button>
          <Button
            type="button"
            onClick={() => {
              if (callHistory) {
                setCallNumber({
                  number: callHistory.number,
                  useAudio: true,
                  useVideo: false,
                });
                close();
              }
            }}
            color="primary"
          >
            {t("To Call")}
          </Button>
        </ModalFooter>
      </ModalBody>
    </Modal>
  );
};

export default ModalDetailsCallHistory;
